public abstract class TOD_ImageEffect : MonoBehaviour
{
	public enum ResolutionType
	{
		Low,
		Normal,
		High
	}

	public TOD_Sky sky;

	protected Camera cam;

	private bool supportsDepth;

	private bool supportsHdr;

	private static Vector3[] frustumCornersArray = new Vector3[4];

	protected Material CreateMaterial(Shader shader)
	{
		if (!shader)
		{
			UnityEngine.Debug.Log("Missing shader in " + ToString());
			base.enabled = false;
			return null;
		}
		if (!shader.isSupported)
		{
			UnityEngine.Debug.LogError("The shader " + shader.ToString() + " on effect " + ToString() + " is not supported on this platform!");
			base.enabled = false;
			return null;
		}
		return new Material(shader)
		{
			hideFlags = HideFlags.DontSave
		};
	}

	private TOD_Sky FindSky(bool fallback = false)
	{
		if ((bool)TOD_Sky.Instance)
		{
			return TOD_Sky.Instance;
		}
		if (fallback)
		{
			return UnityEngine.Object.FindObjectOfType(typeof(TOD_Sky)) as TOD_Sky;
		}
		return null;
	}

	protected void Awake()
	{
		if (!cam)
		{
			cam = GetComponent<Camera>();
		}
		if (!sky)
		{
			sky = FindSky(fallback: true);
		}
		supportsDepth = SystemInfo.SupportsRenderTextureFormat(RenderTextureFormat.Depth);
		supportsHdr = SystemInfo.SupportsRenderTextureFormat(RenderTextureFormat.ARGBHalf);
	}

	protected bool CheckSupport(bool needDepth = false, bool needHdr = false)
	{
		if (!cam)
		{
			cam = GetComponent<Camera>();
		}
		if (!cam)
		{
			return false;
		}
		if (!sky)
		{
			sky = FindSky();
		}
		if (!sky || !sky.Initialized)
		{
			return false;
		}
		if (!SystemInfo.supportsImageEffects)
		{
			UnityEngine.Debug.LogWarning("The image effect " + ToString() + " has been disabled as it's not supported on the current platform.");
			base.enabled = false;
			return false;
		}
		if (needDepth && !supportsDepth)
		{
			UnityEngine.Debug.LogWarning("The image effect " + ToString() + " has been disabled as it requires a depth texture.");
			base.enabled = false;
			return false;
		}
		if (needHdr && !supportsHdr)
		{
			UnityEngine.Debug.LogWarning("The image effect " + ToString() + " has been disabled as it requires HDR.");
			base.enabled = false;
			return false;
		}
		if (needDepth)
		{
			cam.depthTextureMode |= DepthTextureMode.Depth;
		}
		if (needHdr)
		{
			cam.allowHDR = true;
		}
		return true;
	}

	protected void DrawBorder(RenderTexture dest, Material material)
	{
		RenderTexture.active = dest;
		bool flag = true;
		GL.PushMatrix();
		GL.LoadOrtho();
		for (int i = 0; i < material.passCount; i++)
		{
			material.SetPass(i);
			float y;
			float y2;
			if (flag)
			{
				y = 1f;
				y2 = 0f;
			}
			else
			{
				y = 0f;
				y2 = 1f;
			}
			float x = 0f + 1f / ((float)dest.width * 1f);
			float y3 = 0f;
			float y4 = 1f;
			GL.Begin(7);
			GL.TexCoord2(0f, y);
			GL.Vertex3(0f, y3, 0.1f);
			GL.TexCoord2(1f, y);
			GL.Vertex3(x, y3, 0.1f);
			GL.TexCoord2(1f, y2);
			GL.Vertex3(x, y4, 0.1f);
			GL.TexCoord2(0f, y2);
			GL.Vertex3(0f, y4, 0.1f);
			float x2 = 1f - 1f / ((float)dest.width * 1f);
			x = 1f;
			y3 = 0f;
			y4 = 1f;
			GL.TexCoord2(0f, y);
			GL.Vertex3(x2, y3, 0.1f);
			GL.TexCoord2(1f, y);
			GL.Vertex3(x, y3, 0.1f);
			GL.TexCoord2(1f, y2);
			GL.Vertex3(x, y4, 0.1f);
			GL.TexCoord2(0f, y2);
			GL.Vertex3(x2, y4, 0.1f);
			x = 1f;
			y3 = 0f;
			y4 = 0f + 1f / ((float)dest.height * 1f);
			GL.TexCoord2(0f, y);
			GL.Vertex3(0f, y3, 0.1f);
			GL.TexCoord2(1f, y);
			GL.Vertex3(x, y3, 0.1f);
			GL.TexCoord2(1f, y2);
			GL.Vertex3(x, y4, 0.1f);
			GL.TexCoord2(0f, y2);
			GL.Vertex3(0f, y4, 0.1f);
			x = 1f;
			y3 = 1f - 1f / ((float)dest.height * 1f);
			y4 = 1f;
			GL.TexCoord2(0f, y);
			GL.Vertex3(0f, y3, 0.1f);
			GL.TexCoord2(1f, y);
			GL.Vertex3(x, y3, 0.1f);
			GL.TexCoord2(1f, y2);
			GL.Vertex3(x, y4, 0.1f);
			GL.TexCoord2(0f, y2);
			GL.Vertex3(0f, y4, 0.1f);
			GL.End();
		}
		GL.PopMatrix();
	}

	protected Matrix4x4 FrustumCorners()
	{
		cam.CalculateFrustumCorners(new UnityEngine.Rect(0f, 0f, 1f, 1f), cam.farClipPlane, cam.stereoActiveEye, frustumCornersArray);
		Vector3 vector = cam.transform.TransformVector(frustumCornersArray[0]);
		Vector3 vector2 = cam.transform.TransformVector(frustumCornersArray[1]);
		Vector3 vector3 = cam.transform.TransformVector(frustumCornersArray[2]);
		Vector3 vector4 = cam.transform.TransformVector(frustumCornersArray[3]);
		Matrix4x4 identity = Matrix4x4.identity;
		identity.SetRow(0, vector);
		identity.SetRow(1, vector4);
		identity.SetRow(2, vector2);
		identity.SetRow(3, vector3);
		return identity;
	}

	protected Vector3i GetSkyMaskSize(RenderTexture source, ResolutionType resolution)
	{
		int x;
		int y;
		int z;
		switch (resolution)
		{
		case ResolutionType.High:
			x = source.width;
			y = source.height;
			z = 0;
			break;
		case ResolutionType.Normal:
			x = source.width / 2;
			y = source.height / 2;
			z = 0;
			break;
		default:
			x = source.width / 4;
			y = source.height / 4;
			z = 0;
			break;
		}
		return new Vector3i(x, y, z);
	}

	protected RenderTexture GetSkyMask(RenderTexture source, Material skyMaskMaterial, Material screenClearMaterial, ResolutionType resolution, Vector3 lightPos, int blurIterations, float blurRadius, float maxRadius)
	{
		Vector3i skyMaskSize = GetSkyMaskSize(source, resolution);
		int x = skyMaskSize.x;
		int y = skyMaskSize.y;
		int z = skyMaskSize.z;
		RenderTexture temporary = RenderTexture.GetTemporary(x, y, z);
		RenderTexture renderTexture = null;
		skyMaskMaterial.SetVector("_BlurRadius4", new Vector4(1f, 1f, 0f, 0f) * blurRadius);
		skyMaskMaterial.SetVector("_LightPosition", new Vector4(lightPos.x, lightPos.y, lightPos.z, maxRadius));
		if ((cam.depthTextureMode & DepthTextureMode.Depth) != DepthTextureMode.None)
		{
			Graphics.Blit(source, temporary, skyMaskMaterial, 1);
		}
		else
		{
			Graphics.Blit(source, temporary, skyMaskMaterial, 2);
		}
		if (cam.stereoActiveEye == Camera.MonoOrStereoscopicEye.Mono)
		{
			DrawBorder(temporary, screenClearMaterial);
		}
		float num = blurRadius * 0.0013020834f;
		skyMaskMaterial.SetVector("_BlurRadius4", new Vector4(num, num, 0f, 0f));
		skyMaskMaterial.SetVector("_LightPosition", new Vector4(lightPos.x, lightPos.y, lightPos.z, maxRadius));
		for (int i = 0; i < blurIterations; i++)
		{
			renderTexture = RenderTexture.GetTemporary(x, y, z);
			Graphics.Blit(temporary, renderTexture, skyMaskMaterial, 0);
			RenderTexture.ReleaseTemporary(temporary);
			num = blurRadius * (((float)i * 2f + 1f) * 6f) / 768f;
			skyMaskMaterial.SetVector("_BlurRadius4", new Vector4(num, num, 0f, 0f));
			temporary = RenderTexture.GetTemporary(x, y, z);
			Graphics.Blit(renderTexture, temporary, skyMaskMaterial, 0);
			RenderTexture.ReleaseTemporary(renderTexture);
			num = blurRadius * (((float)i * 2f + 2f) * 6f) / 768f;
			skyMaskMaterial.SetVector("_BlurRadius4", new Vector4(num, num, 0f, 0f));
		}
		return temporary;
	}
}
